import About from '../components/AboutUs/About';
import Header from '../components/Header';
import SignUp from '../components/SignUp';
import Footer from '../components/Footer';


function AboutUs() {
    return (
        <div>
            <Header />
            <About />
            <SignUp />
            <Footer />
        </div>
    )
}

export default AboutUs;
